import React from "react";

class Weather extends React.Component {
  render() {
    return (
      <div>
        { this.props.city && this.props.country && <div className="Location">Location: { this.props.city }, { this.props.country}</div>}
        Temperature: { this.props.temperature }
        Min_Temperature: { this.props.temp_min }
        Max_Temperature: { this.props.temp_max }
        Weather: { this.props.description }
      </div>
    )
 }  
}

export default Weather;
